    return (
        <div>
            
                
                <Row className='roomsHead'>
                    <Col>
                        <h1>PRIVATE</h1>
                    </Col>
                </Row>
                <Row className='roomsContainer'>
                    {/* Public rooms list */}
                    <Col className='privateNav'></Col> 
                </Row>
                <button
                    onClick={() => {
                        setPriv(false);
                    }}>
                        XXX
                </button>
        </div>
    )
}

export default Private
